import React from 'react';
import './App.css';
import logo from './logo.png'
import example from './example.jpg';

function App () {
  return (
    <div className="{ 'sticky shadow-2': isSticky }" x-init="window.addEventListener('scroll', () => { isSticky = window.scrollY > 0 })" >
          <div className="absolute inset-0">
                  <img src={example} className="h-full w-full object-cover" alt="" />
                  <div className="absolute inset-0 bg-black opacity-40"></div>
              </div>
              <div className="relative mx-auto max-w-7xl pb-16 sm:py-24 lg:pt-64">
                  <h1 data-aos="fade-left" data-aos-duration="300" className="text-4xl max-w-2xl lg:text-6xl my-6 font-medium text-black lg:py-0 py-5 ">
                      Reducing Emissions, Improving Lives
                  </h1>
                  <div className="text-white max-w-2xl pb-5">Smart, efficient, and sustainable fuel usage made easy! Join Pika na Power for an electrifying culinary journey today!</div>
              </div>
      </div>
  );
}

export default App;
